В строке `std::vector<int>timeList;` вы объявляете вектор `timeList`, но не инициализируете его никакими значениями. Затем, в цикле `for`, вы пытаетесь обратиться к элементам вектора, которых еще нет. Это приведет к неопределенному поведению программы. Чтобы исправить это, вы можете использовать функцию `push_back()` для добавления элементов в вектор.

В строке `timeList[i-1]+2;` вы пытаетесь изменить значение элемента вектора, но не сохраняете это изменение. Вы можете использовать оператор присваивания (`=`) для сохранения измененного значения.
В строке `std::cout<<timeList[timeList.size()-1]-1<<std::endl;` вы выводите значение элемента вектора, но вычитаете из него 1. Это может привести к неправильным результатам. Если вы хотите вывести предыдущее значение элемента, то вам нужно использовать `timeList[timeList.size()-2]`.

Исправленный код будет выглядеть следующим образом:

```cpp
#include <iostream>
#include <vector>

int main() {
    std::vector<int> timeList;
    for(int i=0; i<10; ++i){
        timeList.push_back(i+2);
        std::cout << timeList[timeList.size()-2] << std::endl;
    }
    std::cout << timeList.size() << "\t" << timeList[timeList.size()-1] << "\n";
}
```

В этом коде мы исправили ошибки и добавили значения вектора `timeList` с помощью функции `push_back()`. Затем мы выводим предыдущее значение каждого элемента вектора и выводим размер вектора и последний элемент.

